    false,nt"url": null,nt"notes": "This annual narrative report for Clarence
    Cannon NWR outlines Refuge accomplishments during the 1991 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses compliance with
    environmental and cultural resource mandates. Refuge administration is outlined;
    information about personnel, youth programs, volunteer programs, funding, and safety
    is given. Habitat management is also covered; subjects include wetlands, croplands,
    fire management, pest control, and private lands. The wildlife section of the report
    discusses endangered and threatened species, waterfowl, marsh birds and waterbirds,
    shorebirds, raptors, game mammals, fisheries resources, and animal control. The
    public uses of the Refuge described in this report include outdoor classrooms, interpretive
    programs, wildlife observation, and law enforcement. The equipment and facilities
    section of the report provides information about rehabilitation, major maintenance,
    equipment replacement, communication systems, and energy conservation. Items of
    interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
